1969, Cape Canaveral Florida. In het grasveldje naast het platform waar vandaan de rakketten gelanceerd worden, fantaseren drie jonge huisvliegen genaamd Nat en zijn twee beste vriendjes I.Q. en Scooter hoe het zou zijn om met de Apollo 11 op maanverkenningsvlucht te gaan. Zo slagen ze erin om als verstekeling aan de boord te komen van de Apollo raket door in de helmen te kruipen van de ruimtevaarders Armstrong, Aldrin en Collins. Eenmaal in de ruimte doen zij spectaculaire ervaringen op die niet onopgemerkt blijven bij het thuisfront.

